    lines = []
    current_line = ""
    current_column = 0
    wait_for_nl = False
    in_indent = False
    for char in prefix:
        current_line += char
        if char == ' ':
            current_column += 1
            in_indent = True
        elif char == '\t':
            current_column += 4
            in_indent = True
        elif char == '\n':
            if in_indent:
                in_indent = False
            else:
                if current_line.strip() and current_column < column:
                    res = ''.join(lines)
                    return res, prefix[len(res):]
                lines.append(current_line)
                current_line = ""
                current_column = 0
        else:
            wait_for_nl = True
            in_indent = False
